import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import '../App.css';
import axios from 'axios';

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      latestProject: []
    };
  }

  componentDidMount() {
    axios
      .get('http://localhost:8082/api/projects')
      .then(res => {
        this.setState({
          latestProject: res.data
        })
      })
      .catch(err =>{
        console.log('Error from ShowProjectList');
      })
  };

  render() {
    const latestProject = this.state.latestProject;

    return (
      <div className="Home">
        <div className="project-container">
            <div className="desc">
                <h2>
                    <Link to={`/show-project/${latestProject._id}`}>
                        <h4>{ latestProject.title }</h4>
                    </Link>
                </h2>
                <br/>
                <p>{latestProject.description}</p>
            </div>
        </div>
      </div>
    );
  }
}

export default Home;
